import React,{Component} from 'react';
import './App.css';

class Items extends Component {



  render () {
    return <li>
      <label>
        <input type="checkbox" name="name" onChange={() => this.handleChange(this.props.items.id)}
               checked={this.props.items.checked}/>
        {this.props.items.label}
      </label>
    </li>
  }
}

export default Items;
